pragma solidity ^0.4.11;
import './LearnerLearningProvider.sol';

contract UserIndex {
    struct LearningRecordDescriptor {
        address llpcAddress;
        bytes recordType;
    }

    mapping(address => LearningRecordDescriptor[]) providers2LearningRecords;
    mapping(address => bool) public duplicateTracker;
    mapping(bytes => address) recordType2LLPC;
    mapping(address => bool) public duplicateProviderTracker;
    address[] myLearningProviders;
    address owner;

    function UserIndex(address _owner) public {
        owner = _owner;
    }

    function insertLearningRecord(address provider, address llpcContract, bytes recordType) public payable {
        LearnerLearningProvider llpc = LearnerLearningProvider(llpcContract);
        if (llpc.getOwner() == owner && duplicateTracker[llpcContract] == false && llpc.canWrite(msg.sender) == true &&
          (recordType2LLPC[recordType]== address(0) || recordType2LLPC[recordType] == llpcContract)) {
              LearningRecordDescriptor memory ld = LearningRecordDescriptor(llpcContract, recordType);
            providers2LearningRecords[provider].push(ld);
            duplicateTracker[llpcContract] = true;
            if(recordType2LLPC[recordType] == address(0)) {
                recordType2LLPC[recordType] = llpcContract;
            }
        }
    }

    function insertLearningProvider(address providerAddress) public payable {
            if(duplicateProviderTracker[providerAddress] == false){
                myLearningProviders.push(providerAddress);
                duplicateProviderTracker[providerAddress] = true;
            }
    }

    function getOwner() public view returns (address _owner) {
        return owner;
    }

    function getLearningProviders() public view returns (address[]) {
        return myLearningProviders;
    }

    function getRecordTypeLLPC(bytes recordType) public view returns (address) {
        return recordType2LLPC[recordType];
    }

    function getLearningRecordsByProvider(address provider, uint start, uint end) public view returns (address[]) {
        address[] memory res = new address[](end-start);
        for (var index = start; index<providers2LearningRecords[provider].length && index <= end; index++) {
            res[(start-index)] = providers2LearningRecords[provider][index].llpcAddress;
        }
        return res;
    }

    function getLearningRecordsByRecordType(address provider, uint start, uint end, bytes recordType) public view returns (address[]) {
        address[] memory res = new address[](end-start);
        for (var index = start; index<providers2LearningRecords[provider].length && index<=end; index++) {
            if (keccak256(providers2LearningRecords[provider][index].recordType) == keccak256(recordType)) {
                res[(start-index)] = providers2LearningRecords[provider][index].llpcAddress;
            }
        }
        return res;
    }

    function getLearningRecordsByRecordTypeAndProviders(address[] providers, uint start, uint end, bytes recordType) public view returns (address[]) {
        address[] memory res = new address[](end-start);
        for (var index2 = start; index2 <= providers.length; index2++) {
            for (var index = start; index < providers2LearningRecords[providers[index2]].length && index <= end; index++) {
            if (keccak256(providers2LearningRecords[providers[index2]][index].recordType) == keccak256(recordType)) {
                res[(start-index)] = providers2LearningRecords[providers[index2]][index].llpcAddress;
            }
        }
        }
        return res;
    }

}
